    //get image url
    window.readURL = function readURL(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            $("#fileuperror").empty();
            var fileInput =
                document.getElementById('uploadImage');
    
            var filePath = fileInput.value;
    
            var allowedExtensions =
                /(\.jpg|\.jpeg|\.png|\.gif)$/i;
    
            if (!allowedExtensions.exec(filePath)) {
                $("#fileuperror").html("<p style='color:#FF0000'>Image format must be JPG, JPEG, PNG or GIF.</p>");
                fileInput.value = '';
                return false;
            }
            var file_size = $('#uploadImage')[0].files[0].size;
            if (file_size > 10000000) {
                $("#fileuperror").html("<p style='color:#FF0000'>File size is greater than 10 MB</p>");
                $(".userProfile_thumb").css("border-color", "#FF0000");
                return false;
            }
            reader.onload = function (e) {
                $("#blah").css("display", "block");
                $(".icon-camera").css("opacity", "0");
    
                $('#blah')
                    .attr('src', e.target.result);
            };
    
            reader.readAsDataURL(input.files[0]);
        }
    }
    
    function readmoredata() {
        var dots = document.getElementById("dots");
        var moreText = document.getElementById("more");
        var btnText = document.getElementById("myBtnmoreread");
    
        if (dots.style.display === "none") {
            dots.style.display = "inline";
            btnText.innerHTML = "Read more";
            moreText.style.display = "none";
        } else {
            dots.style.display = "none";
            btnText.innerHTML = "Read less";
            moreText.style.display = "inline";
        }
    }
    
    window.showButtonLoader = function (button, text = '', action) {
        if (action === 'disabled') {
            button.append('<span class="buttonLoader spinner-border spinner-border-sm ml-2"></span>');
            button.prop('disabled', true);
        } else {
            $(button).find('.spinner-border').remove();
            button.prop('disabled', false);
        }
    }
    
    //time diffrence function
    function fromNowtime(date, nowDate = Date.now(), rft = new Intl.RelativeTimeFormat(undefined, { numeric: "auto" })) {
        const SECOND = 1000;
        const MINUTE = 60 * SECOND;
        const HOUR = 60 * MINUTE;
        const DAY = 24 * HOUR;
        const WEEK = 7 * DAY;
        const MONTH = 30 * DAY;
        const YEAR = 365 * DAY;
        const intervals = [
            { ge: YEAR, divisor: YEAR, unit: 'year' },
            { ge: MONTH, divisor: MONTH, unit: 'month' },
            { ge: WEEK, divisor: WEEK, unit: 'week' },
            { ge: DAY, divisor: DAY, unit: 'day' },
            { ge: HOUR, divisor: HOUR, unit: 'hour' },
            { ge: MINUTE, divisor: MINUTE, unit: 'minute' },
            { ge: 30 * SECOND, divisor: SECOND, unit: 'seconds' },
            { ge: 0, divisor: 1, text: 'just now' },
        ];
        const now = typeof nowDate === 'object' ? nowDate.getTime() : new Date(nowDate).getTime();
        const diff = now - (typeof date === 'object' ? date : new Date(date)).getTime();
        const diffAbs = Math.abs(diff);
        for (const interval of intervals) {
            if (diffAbs >= interval.ge) {
                const x = Math.round(Math.abs(diff) / interval.divisor);
                const isFuture = diff < 0;
                return interval.unit ? rft.format(isFuture ? x : -x, interval.unit) : interval.text;
            }
        }
    }
    
    window.checkCreateGroupPermission = function checkCreateGroupPermission(userId, page = '') {
        $.ajax({
            url: 'check-create-group-session-permission',
            type: "POST",
            data: { userId: userId },
            processData: true,
            contentType: false,
            headers: {
                'X-CSRF-TOKEN': $('input[name="_token"]').val()
            },
            dataType: 'JSON',
            cache: false,
            contentType: false,
            success: function success(response) {
                if (response.success == true) {
                    if (page != 'create-session') {
                        window.location.href = 'create-session';
                    }
                } else {
                    if (page == 'create-session') {
                        alert(response.error.message);
                        window.location.href = 'home';
                    }
                    toastr.error(response.error.message);
                }
            },
            error: function error(data) {
                if (data.status === 422) {
                    var responseText = $.parseJSON(data.responseText);
                    if (page == 'create-session') {
                        console.log(data.responseText)
                        alert(responseText.error.message);
                        window.location.href = 'home';
                    }
                    toastr.error(responseText.error.message);
                }
                if (data.status === 400) {
                    var responseText = $.parseJSON(data.responseText);
                    if (page == 'create-session') {
                        console.log(data.responseText)
                    }
                    toastr.error(responseText.message);
                }
            }
        });
    }
    
    
