    function readURL(input, type) {
        if (input.files && input.files[0]) {
            if(input.files[0].type == 'image/jpeg' || input.files[0].type == 'image/png' || input.files[0].type == 'image/jpeg' || input.files[0].type == 'image/gif' ||  input.files[0].type == 'image/peng'){
               var reader = new FileReader();
                reader.onload = function(e) {
                    var image = new Image();
                    image.src = e.target.result;
                    image.onload = function() {
                        var imageHeight = this.height;
                        var imageWidth = this.width;
                        $("#imageCropperModal").modal("show");
                        $('#image_container').html('<img alt="image" src="'+e.target.result+'" id="crop_image" class="img-fluid">');
                        $('#type').val(type);
                            loadCoverCropper(type);
                        
                    };
                }
             reader.readAsDataURL(input.files[0]); // convert to base64 string
            }else{
                toastr.error('Only files with the flowing extension are allowed: png,gif,jpg,jpeg');
            }
        }
    }
    function loadCoverCropper(type) {
        var $imageCover = $("#crop_image");
            $imageCover.cropper({
                movable: true, 
                zoomable: false,
                strict: false,
                highlight: true,
                center: true,
                responsive: true,
                cropBoxResizable: false,
                viewMode:1,
                toggleDragModeOnDblclick: false,
                cropBoxMovable: true,
    
            });
    }
